PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
ASK {
  wd:Q183 p:P1082 ?stmt2010 .
  ?stmt2010 ps:P1082 ?pop2010 ; pq:P585 ?date2010 .
  FILTER ( YEAR( ?date2010 ) = 2010 ) {
    SELECT ( MAX( ?date ) AS ?maxDate ) WHERE {
      wd:Q183 p:P1082 ?stmt .
      ?stmt pq:P585 ?date .
    }
  }
  wd:Q183 p:P1082 ?stmtLatest .
  ?stmtLatest pq:P585 ?maxDate ; ps:P1082 ?latestPop .
  BIND( ( ?latestPop - ?pop2010 ) / ?pop2010 * 100 AS ?growth ) FILTER ( ?growth >= 1 )
}

