PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?material ?materialLabel WHERE {
  wd:Q39231 wdt:P186 ?material .
  OPTIONAL {
    ?material rdfs:label ?materialLabel .
    FILTER ( LANG( ?materialLabel ) = "en" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?event ?deaths ?eventLabel WHERE {
  ?event wdt:P31 / wdt:P279 * wd:Q1656682 .
  ?event wdt:P1120 ?deaths .
  {
    ?event wdt:P580 ?start .
    ?event wdt:P582 ?end .
    FILTER ( ?start <= "1920-12-31T23:59:59Z" ^^ xsd:dateTime && ?end >= "1910-01-01T00:00:00Z" ^^ xsd:dateTime )
  } UNION {
    ?event wdt:P585 ?date .
    FILTER ( ?date >= "1910-01-01T00:00:00Z" ^^ xsd:dateTime && ?date <= "1920-12-31T23:59:59Z" ^^ xsd:dateTime )
  }
  ?event rdfs:label ?eventLabel .
  FILTER ( lang( ?eventLabel ) = "en" )
}
ORDER BY DESC ( ?deaths )
LIMIT 1

